import React from 'react';

const OfferBox = ({ isNew, title, description }) => {
    return (
        <div className="offer-box">
            {isNew && <div className="new-dot">Nowosc</div>}
            <h2>{title}</h2>
            <p>{description}</p>
        </div>
    );
};

export default OfferBox;
